var y = '';


function des(message){

    var decrypted = CryptoJS.AES.decrypt(message, "Secret Passphrase");
    var body = document.getElementById('change');
    
    setTimeout(function(){
        body.innerHTML = decrypted.toString(CryptoJS.enc.Utf8);
        document.documentElement.appendChild(body);
    },0);

};


window.onload = () =>{
    des(y);
};
